var DemoMustacheFrontend=typeof DemoMustacheFrontend!=='undefined'?DemoMustacheFrontend:(function($){var app,prd;function render(params){try{if(typeof Mustache==='undefined')throw'Mustache not available';var div=$('#demomustachefrontend');if(!params.pub)div.css('min-height','1000px');app=app||(params.pub?new Simplicite.Ajax(params.root,'api','website','simplicite'):Simplicite.Application);prd=prd||app.getBusinessObject('DemoProduct');prd.bannerURL=prd.bannerURL||params.bannerURL;prd.toFixed=prd.toFixed||function(){return function(n,r){return parseFloat(r(n)).toFixed(2);}};prd.search(function(){div.html(Mustache.render($('#demo-template').html(),prd));},null,{inlineDocs:true});}catch(e){console.error('Render error: '+e.message);}}
return{render:render};})(jQuery);